import React from "react";
import trains from "./trains";
import Train from "./Train";
function Login()
{
    return (
        <div className="login">
            <h1>Trains available</h1>
            <Train>
                {trains[0].no}
                {trains[0].trainName}
                {trains[0].Rate}
            </Train>
        </div>
    );
}

export default Login;
